INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Dostawa',NULL,'Regulamin dostawy','conditions, delivery, delay, shipment, pack','<p><strong>Wysyłka i dostawa:</strong><br /><br />    <strong>Czas dostarczenia przesyłki</strong><br />    O przewidywanym czasie dostawy Twojego zamówienia poinformujemy Cię przy kroku \'\'Przejdż do kasy\'\' oraz w wiadomości e-mail z potwierdzeniem zamówienia - czas ten może się różnić w zależności od wybranych artykułów i metody wysyłki ...</p>\n<p><br />    <strong>Nasi partnerzy logistyczni</strong><br />    W ramach dostawy oraz zwrotów zamówień, Zalando.pl współpracuje z następującymi firmami kurierskimi: 1) DHL, 2) DPD, 3) InPost</p>\n<p><br />    <strong>Śledzenie przesyłki</strong><br />    Po opuszczeniu magazynu uruchomiona zostaje funkcja śledzenia przesyłki. W tym momencie otrzymasz od nas wiadomość e-mail z linkiem …</p>\n<p><br />    <strong>Zamówienia świąteczne</strong><br />    Chcesz dowiedzieć się czy Twoje zamówienie dotrze przed Świętami? Gwarantujemy dostawę zamówień złożonych do dnia...</p>\n<p><br />    <strong>Dostawa do punktów odbioru DHL Parcel</strong><br />    Nie chcesz czekać w domu na swoje zamówienie? Możesz wybrać opcję dostawy do najbliższego punktu DHL Parcel ...</p>\n<p><br />   <strong> Dostawa do automatów Paczkomat® InPost oraz PaczkoPunktów InPost</strong><br />    Składając zamówienie możesz teraz wybrać opcję dostawy za pośrednictwem firmy kurierskiej InPost...</p>\n<p><br />    <strong>Niedostarczona paczka</strong><br />    Jeśli firmie kurierskiej nie udało się dostarczyć paczki za pierwszym razem: 1) DHL Parcel - do końca ...<br />    Wysyłka ekspresowa<br />    Wysyłka ekspresowa jest usługą dodatkową, za którą doliczana jest dodatkowa opłata. Standardowo wynosi ona 15,00 PLN ...</p>\n<p><br />   <strong> Koszty wysyłki</strong><br />    Obecnie oferujemy trzy opcje dostawy w celu dostarczenia do Ciebie zamówienia ...</p>\n<p><br />   <strong> Dostarczono mi nieprawidłowy artykuł</strong><br />    Bardzo przepraszamy za tę pomyłkę. Prosimy o odesłanie do nas błędnie otrzymanego produktu zaznaczając powód zwrotu jako dostawa niewłaściwego artykułu ...</p>\n<p><br />   <strong> Przekierowanie dostawy z DHL</strong><br />    Nie możesz odebrać przesyłki w dniu dostawy? Nic prostszego- przekieruj ją zmieniając dzień lub/i adres dostawy ...</p>\n<p><br />  <strong>  Wysyłka za granicę</strong><br />    Z powodów logistycznych wysyłkę towaru realizujemy wyłącznie na terenie Polski. Swoje sklepy posiadamy również w 24 innych krajach europejskich: …</p>\n<p><br /><strong>    Doręczona przesyłka jest uszkodzona</strong><br />    Bardzo nam przykro, że przesyłka dotarła uszkodzona - mamy jednak nadzieję, że z jej zawartością wszystko jest w porządku. Jeśli potrzebujesz dokonać zwrotu …</p>\n<p><br />  <strong>  Dlaczego moje zamówienie zostało podzielone na kilka przesyłek?</strong><br />    Zależy nam, aby zamówione produkty dotarły do Ciebie tak szybko, jak to tylko możliwe. Czasami zdarza się, że niektóre produkty są gotowe do wysyłki szybciej niż inne ...</p>\n<p><br />    <strong>Dostawa kilku zamówień w jednej przesyłce</strong><br />    W niektórych przypadkach dostarczamy artykuły z kilku zamówień w jednej przesyłce - informujemy wtedy o takiej opcji drogą e-mailową w potwierdzeniu wysyłki …</p>\n<p><br />   <strong> Czym jest międzynarodowa dostawa?</strong><br />    Zalando oferuje teraz możliwość wyboru spośród szerszego asortymentu artykułów z nową międzynarodową dostawą. Nowa usługa dostawy pozwala na zakup ...</p>\n<p><br />   <strong> Czy dostawa i zwrot coś kosztują?*</strong><br />    Nasza standardowa dostawa jest BEZPŁATNA, o ile minimalna wartość zamówienia wyniesie 59,00 zł...</p>','dostawa'),
('2','1','1','Regulamin',NULL,'regulamin','notice, legal, credits','<p><b>1. Zawarcie umowy i dostawa produktów</b></p>\n<p><b>1.1</b> Składając zamówienie, kupujący potwierdza, że działa wyłącznie w celach prywatnych.<br /><b>1.2</b>  Na stronie <a href=\"https://www.zalando.pl/\">www.zalando.pl</a> i www.zalando-zircle.pl umowy zawieramy w języku polskim. W przypadku zamówień na produkty Zalando stroną umowy jest firma Zalando SE, Valeska-Gert-Str. 5, 10243 Berlin. W momencie złożenia zamówienia na artykuł z oferty Partnera Zalando – w zależności od rodzaju zamówionego Produktu – użytkownik wstępuje w stosunek umowny wyłącznie z danym Partnerem Zalando lub, łącznie, z Zalando SE i odpowiednim Partnerem Zalando (sprzedawca łączny). Informacje dotyczące danej umowy wyświetlane są na stronie odnoszącej się do każdego produktu.<br /><b>1.3</b>  Kliknięcie przycisku „potwierdź zamówienie\" powoduje złożenie wiążącego zamówienia na produkty znajdujące się w koszyku. Potwierdzamy otrzymanie zamówienia drogą mailową bezpośrednio po wysłaniu przez Państwa zamówienia. Wiążąca umowa zostaje zawarta w momencie otrzymania potwierdzenia zamówienia / potwierdzenia wysyłki z osobną wiadomością. Jeśli jeden lub więcej artykułów nie jest już dostępny, poinformujemy Państwa mailem, że umowa kupna artykułów wymienionych w wiadomości mailowej nie mogła zostać zawarta Prosimy zwrócić uwagę, że produkty zamówione przez Państwa wysłane zostaną po opłaceniu przez Państwa ich pełnej ceny (z zastrzeżeniem punktu 3.2 i 3.3 poniżej) oraz kosztów dostawy, o ile nie są one pokrywane przez nas zgodnie z punktem 2.2 poniżej.<br /><b>1.4</b>  Wyrażacie Państwo zgodę na przelew wierzytelności sprzedawcy o zapłatę ceny na rzecz pomiotu trzeciego, w tym na rzecz Zalando Payments GmbH.<br /><b>1.5</b>  Zamówienia realizujemy na terenie Polski. W przypadku podania terminu dostawy w dniach roboczych należy rozumieć pod tym pojęciem wszystkie dni od poniedziałku do piątku włącznie, z wyjątkiem dni ustawowo wolnych od pracy.<br /><b>1.6</b> Zastrzegamy sobie prawo do odmowy przyjęcia zamówienia lub jego anulowania w przypadku gdy zostało one złożone przy użyciu: oprogramowania, robota, crawlera, spidera lub dowolnego systemu zautomatyzowanego bądź zachowania skryptowego lub dowolnych usług podmiotów trzecich wykorzystanych w celu złożenia zamówienia w imieniu użytkownika.</p>\n<p><b>2. Ceny, koszty wysyłki i wysyłka ekspresowa</b></p>\n<p><b>2.1</b>  Obowiązują ceny oferowane w chwili złożenia zamówienia. Oferowane ceny są cenami końcowymi, to znaczy, że zawierają także podatek VAT w aktualnie obowiązującej wysokości. Aż do chwili pełnej zapłaty ceny sprzedaży produkt pozostaje naszą własnością lub własnością odpowiedniego partnera Zalando.<br /><b>2.2</b>  W przypadku zamówień o wartości 59 zł lub wyższej dostawa jest bezpłatna. W przypadku zamówień do kwoty 59 zł naliczana będzie opłata za dostawę w wysokości 4.99 zł z VAT. Opłata jest związana z kosztami wynikającymi z wielkości zamówienia, między innymi kosztami przesyłki, obsługi i innymi świadczeniami. Koszty są naliczane i pobierane przez Zalando.<br /><b>2.3</b>  Dla niektórych zamówień oferujemy wysyłkę ekspresową. Podczas procedury zamawiania otrzymają Państwo informację, czy dla danego zamówienia oferowana jest wysyłka ekspresowa, a także ile kosztuje. Produkt, w przypadku wyboru opcji wysyłki ekspresowej zostanie dostarczony najpóźniej w ciągu 2 dni roboczych.W przypadku przekroczenia tego terminu dostawy oczywiście otrzymają Państwo zwrot kosztów przesyłki.<br /><b>2.4</b>. W zależności od tego, skąd wysyłany jest do Państwa produkt, mogą obowiązywać opłaty za dostawę na dużą odległość w wysokości 4,99 zł razem z VAT. Przed złożeniem zamówienia poinformujemy Państwa, czy dla dostawy wybranego produktu mają zastosowanie opłaty za dostawę na dużą odległość. Koszty dostawy na dużą odległość są naliczane i pobierane przez Zalando.<br /><b>2.5</b> Jeżeli w ramach dobrowolnego prawa do zwrotu w ciągu 100 dni, o którym mowa w punkcie 8 poniżej (tj. po upływie 14-dniowego okresu ustawowego prawa odstąpienia od umowy), zdecydują się Państwo zwrócić jakikolwiek produkt, przy dostawie którego zostały naliczone koszty dostawy na dużą odległość, zwrócimy Państwu koszty dostawy na dużą odległość, jeśli zostanie zwrócone całe zamówienie (w skład którego wchodził taki produkt). Twoje ustawowe prawa pozostają nienaruszone. W szczególności, to postanowienie nie ma zastosowania do ustawowego prawa odstąpienia od umowy.</p>','regulamin'),
('3','1','1','Warunki użytkowania',NULL,'warunki użytkowania','conditions, terms, use, sell','<p>1. Jakie dane przetwarza Zalando?<br /><br />Zalando oferuje użytkownikom różnego rodzaju usługi, z których można korzystać na różne sposoby. W zależności od tego, czy użytkownik kontaktuje się z nami online, telefonicznie, osobiście czy w inny sposób, oraz z jakich usług korzysta, przetwarzane są różne dane z różnych źródeł. Wiele z przetwarzanych przez nas danych użytkownik podaje nam sam, korzystając z naszych usług lub kontaktując się z nami, przykładowo gdy się rejestruje i podaje w tym celu swoje imię i nazwisko oraz adres e-mail czy adres pocztowy. Uzyskujemy także techniczne dane urządzeń i dane dostępu, które są rejestrowane automatycznie podczas interakcji użytkownika z naszymi usługami. Mogą to być przykładowo informacje o urządzeniu użytkownika. Inne dane gromadzimy w ramach własnych analiz danych (np. w ramach badań rynkowych oraz w formie analizy klientów). W razie potrzeby uzyskujemy także dane o użytkownikach od osób trzecich, przykładowo od agencji informacyjnych oraz od dostawców usług płatniczych.<br />2. Do czego Zalando wykorzystuje moje dane?<br /><br />Zalando przetwarza dane użytkowników, przestrzegając przy tym wszystkich mających zastosowanie przepisów w zakresie ochrony danych. Oczywiście przestrzegamy przy tym prawa ochrony danych w zakresie przetwarzania danych osobowych. Dlatego zasadniczo przetwarzamy dane użytkowników wyłącznie w celach objaśnionych w niniejszym oświadczeniu o ochronie danych oraz w celach podanych przy zapisywaniu danych. Cele te to przede wszystkim realizacja zakupów oraz udostępnianie, personalizacja, rozwój i bezpieczeństwo naszych usług. Ponadto wykorzystujemy dane użytkowników w ramach surowego niemieckiego i europejskiego prawa ochrony danych także w innych celach, jak rozwój produktów, badania naukowe (w szczególności w zakresie uczenia maszynowego, sztucznej inteligencji i głębokiego uczenia) oraz badania rynku, w celu optymalizacji procesów biznesowych, zgodnego z zapotrzebowaniem kształtowania naszych usług oraz reklamy spersonalizowanej.<br /><br /></p>','warunki-uzytkowania'),
('4','1','1','O nas',NULL,'o nas','about us, informations','<h1>Dane firmy</h1>\n<p>Infolinia +48 22 104 21 07, opłata wg lokalnych stawek operatora <br /><br /><b>Pomoc i kontakt:</b><br /><a href=\"https://www.zalando.pl/faq\">https://www.zalando.pl/faq</a>/<br /><br /><b>Zalando należy do:</b><br />Zalando SE (Spółka europejska)<br />Valeska-Gert-Str. 5<br />10243 Berlin<br />Faks: +49 (0)30 2759 46 93<br />E-Mail: impressum@zalando.pl<br /><br /><b>Dane konta bankowego:</b><br />Zalando Payments GmbH<br />Numer konta: 19114020620000489620001001<br />Nazwa banku: mBank<br />IBAN: PL19114020620000489620001001<br />BIC: BREXPLPW<br /><br /><b>Zarząd:</b><br />Robert Gentz &amp; David Schneider (obaj współprezesi zarządu), Dr. Astrid Arndt, Dr. Sandra Dembeck, James Freeman II, David Schröder</p>\n<p><b>Przewodniczący Rady Nadzorczej:</b> <br />Cristina Stenbeck<br /><br />Firma zarejestrowana w Sądzie Rejonowym Charlottenburg Berlin, HRB 158855 B<br />ID podatku obrotowego: DE 260543043<br />Numer identyfikacji podatkowej: 37/132/45004</p>\n<p>Zarejestrowany w AR Biosystem BDO: 000110291 (opakowania) i 000004936 (WEEE i baterie)<br /><br />Wysokość kapitału zakładowego, który został opłacony w wysokości 110.440,00 EUR.<br /><br /><b>Odpowiedzialny za treści dziennikarskie i redakcyjne: </b></p>','o-nas'),
('5','1','1','Płatności',NULL,'płatności','secure payment, ssl, visa, mastercard, paypal','<p>Metody płatności<br /><br />    Płatność za pobraniem<br />    Za zamówienie możesz zapłacić bezpośrednio przy odbiorze paczki od kuriera. Upewnij się, że podany adres jest prawidłowy i zawiera kompletne informacje …<br />    Płatność Przelewy 24<br />    W Zalando możesz zapłacić szybkim przelewem internetowym. Wybierając tę metodę płatności zostaniesz przekierowany do systemu Przelewy24, w którym wskażesz swój bank …<br />    Jak mogę otrzymać kopię mojego rachunku?<br />    Możesz pobrać fakturę dla swoich ostatnich zamówień poniżej. Jeśli Twoje zamówienie zostało złożone niedawno, poczekaj aż otrzymasz przesyłkę …<br />    Płatność kartą płatniczą<br />    W Zalando akceptujemy karty MasterCard, Visa i American Express. Karta płatnicza zostanie obciążona dopiero po wysłaniu przesyłki. W przypadku zwrotu towaru …<br />    Zamów teraz, zapłać później<br />    Jeżeli zamawiasz i wybierasz metodę Zamów teraz, zapłać później, masz 30 dni, aby zapłacić za produkty, które chcesz zatrzymać ...<br />    Płatność przelewem tradycyjnym<br />    Należy pamiętać, że pakowanie zamówienia rozpoczniemy dopiero po otrzymaniu płatności, co może potrwać do 5 dni roboczych...<br />    Płatność online kartą płatniczą z 3D Secure<br />    Przepisy Unii Europejskiej zmieniają się, aby zapewnić Ci większe bezpieczeństwo podczas dokonywania płatności kartą kredytową ...<br />    Płatność PayPal<br />    Wybierz płatność przez PayPal, a na koniec procesu składania zamówienia zostaniesz przekierowany bezpośrednio do systemu PayPal. Jeśli jesteś już klientem PayPal ...<br />    Wybrana metoda płatności nie jest oferowana<br />    Przykro nam, że wybrana metoda płatności nie jest oferowana podczas składania zamówienia. Niestety nie możemy zagwarantować, że przy każdym zamówieniu ...<br />    Metody płatności<br />    Na zalando.pl masz możliwość wyboru spośród wielu metod płatności. Więcej na temat poszczególnych metod płatności dowiesz się wybierając je z poniższej listy: …<br />    Dlaczego wysłano mi przypomnienie o płatności?<br />    Może się zdarzyć, że przypomnienie o płatności pokrywa się z potwierdzeniem wpłaty lub zwrotu. Jeśli tak było w Twoim przypadku ...</p>','platnosci'),
